import React, { useState } from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import Avatar from '@mui/material/Avatar';
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import Button from '@mui/material/Button';
import Divider from '@mui/material/Divider';

const pilotos = [
  {
    id: 1,
    nombre: 'Max Verstappen',
    equipo: 'Red Bull Racing',
    valor: '45.000.000',
    image_url: 'https://www.formula1.com/content/fom-website/en/drivers/max-verstappen/_jcr_content/image.img.1920.medium.jpg/1677069654166.jpg',
    historial: [
      { fecha: '2025-06-01', valor: 44000000 },
      { fecha: '2025-06-15', valor: 44500000 },
      { fecha: '2025-07-01', valor: 45000000 },
    ],
  },
  {
    id: 2,
    nombre: 'Lewis Hamilton',
    equipo: 'Mercedes',
    valor: '42.000.000',
    image_url: 'https://www.formula1.com/content/fom-website/en/drivers/lewis-hamilton/_jcr_content/image.img.1920.medium.jpg/1677069654166.jpg',
    historial: [
      { fecha: '2025-06-01', valor: 41000000 },
      { fecha: '2025-06-15', valor: 42000000 },
      { fecha: '2025-07-01', valor: 42000000 },
    ],
  },
  {
    id: 3,
    nombre: 'Charles Leclerc',
    equipo: 'Ferrari',
    valor: '40.000.000',
    image_url: 'https://www.formula1.com/content/fom-website/en/drivers/charles-leclerc/_jcr_content/image.img.1920.medium.jpg/1677069654166.jpg',
    historial: [
      { fecha: '2025-06-01', valor: 39000000 },
      { fecha: '2025-06-15', valor: 39500000 },
      { fecha: '2025-07-01', valor: 40000000 },
    ],
  },
  {
    id: 4,
    nombre: 'Fernando Alonso',
    equipo: 'Aston Martin',
    valor: '38.000.000',
    image_url: 'https://www.formula1.com/content/fom-website/en/drivers/fernando-alonso/_jcr_content/image.img.1920.medium.jpg/1677069654166.jpg',
    historial: [
      { fecha: '2025-06-01', valor: 37000000 },
      { fecha: '2025-06-15', valor: 37500000 },
      { fecha: '2025-07-01', valor: 38000000 },
    ],
  },
  {
    id: 5,
    nombre: 'Lando Norris',
    equipo: 'McLaren',
    valor: '36.000.000',
    image_url: 'https://www.formula1.com/content/fom-website/en/drivers/lando-norris/_jcr_content/image.img.1920.medium.jpg/1677069654166.jpg',
    historial: [
      { fecha: '2025-06-01', valor: 35000000 },
      { fecha: '2025-06-15', valor: 35500000 },
      { fecha: '2025-07-01', valor: 36000000 },
    ],
  },
];

export default function MarketPage() {
  const [open, setOpen] = useState(false);
  const [selected, setSelected] = useState(null);

  const handleClick = (piloto) => {
    setSelected(piloto);
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
    setSelected(null);
  };

  return (
    <Box sx={{ p: 2 }}>
      <Typography variant="h5" gutterBottom>Mercado de Pilotos</Typography>
      {pilotos.map((piloto) => (
        <Paper key={piloto.id} sx={{ display: 'flex', alignItems: 'center', p: 2, mb: 2, cursor: 'pointer' }} onClick={() => handleClick(piloto)}>
          <Avatar src={piloto.image_url} alt={piloto.nombre} sx={{ width: 56, height: 56, mr: 2 }} />
          <Box sx={{ flexGrow: 1 }}>
            <Typography variant="subtitle1" sx={{ fontWeight: 600 }}>{piloto.nombre}</Typography>
            <Typography variant="body2" color="text.secondary">{piloto.equipo}</Typography>
          </Box>
          <Typography variant="body1" sx={{ fontWeight: 700, color: '#fbc02d' }}>{piloto.valor} €</Typography>
        </Paper>
      ))}

      {/* Dialog de perfil de piloto */}
      <Dialog open={open} onClose={handleClose} maxWidth="xs" fullWidth>
        {selected && (
          <>
            <DialogTitle sx={{ textAlign: 'center' }}>{selected.nombre}</DialogTitle>
            <DialogContent>
              <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', mb: 2 }}>
                <Avatar src={selected.image_url} alt={selected.nombre} sx={{ width: 100, height: 100, mb: 1 }} />
                <Typography variant="subtitle1" color="text.secondary">{selected.equipo}</Typography>
                <Typography variant="h6" sx={{ color: '#fbc02d', fontWeight: 700 }}>{selected.valor} €</Typography>
              </Box>
              <Divider sx={{ mb: 2 }} />
              <Typography variant="subtitle2" sx={{ mb: 1 }}>Historial de valor:</Typography>
              {selected.historial.map((h, idx) => (
                <Box key={idx} sx={{ display: 'flex', justifyContent: 'space-between', mb: 0.5 }}>
                  <Typography variant="body2">{h.fecha}</Typography>
                  <Typography variant="body2" sx={{ color: '#388e3c', fontWeight: 600 }}>{h.valor.toLocaleString()} €</Typography>
                </Box>
              ))}
            </DialogContent>
            <DialogActions>
              <Button onClick={handleClose} variant="contained" color="primary" fullWidth>Cerrar</Button>
            </DialogActions>
          </>
        )}
      </Dialog>
    </Box>
  );
}
